const ADD_POST = 'ADD-POST';
const  UPDATE_NEW_POST_TEXT = 'UPDATE-NEW-POST-TEXT';
const UPDATE_NEW_POST_BODY= 'UPDATE_NEW_POST_BODY';
const SEND_MESSAGE= 'SEND_MESSAGE';
let store = {
    _state: {
        profilePage: {
            posts: [{id: 1, message: 'How are you?', likesCount: 12},
                {id: 2, message: "It's my first post ", likesCount: 15}],
            newPostText: 'It-kamasutra.com'
        },

        dialogsPage: {
            messages: [
                {id: 1, message: 'Hi'},
                {id: 2, message: 'What is your Dima '},
                {id: 3, message: 'Yo'},],

            dialogs: [{id: 1, name: 'Dima'},
                {id: 2, name: 'Sveta'},
                {id: 3, name: 'Sasha'},
                {id: 4, name: 'Andrey'},
                {id: 5, name: 'Viktor'},
                {id: 6, name: 'Valera'}],
            newMessageBody:''

        },
        sadebar: {
            friends: [
                {
                    name: 'Vasiliy',
                    src: 'data:image/jpeg;base64,'
                },
                {
                    name: 'Andrey',
                    src: 'data:image/jpeg;base64,'
                },
                {
                    name: 'Olga',
                    src: 'data:image/jpeg;base64,'
                }
            ],
        }
    },
    _callSubcribe() {
        console.log('ffafa');
    },

    getState() {
        return this._state;
    },
    subscribe(observer) {
        this._callSubcribe = observer;
    },

    dispatch(action) {
if( action.type === ADD_POST){
    let newPost = {
        id: 3,
        message: this._state.profilePage.newPostText,
        likesCount: 0
    };
    this._state.profilePage.posts.push(newPost);
    this._state.profilePage.newPostText = '';
    this._callSubcribe(this._state);
}else if(action.type=== UPDATE_NEW_POST_TEXT){
    this._state.profilePage.newPostText = action.newText;
    this._callSubcribe(this._state);
}else if(action.type=== UPDATE_NEW_POST_BODY) {
    this._state.dialogsPage.newMessageBody = action.body;
    this._callSubcribe(this._state);
}else if(action.type=== SEND_MESSAGE){
    let body = this._state.dialogsPage.newMessageBody;
    this._state.dialogsPage.newMessageBody = '';
    this._state.dialogsPage.messages.push({id: 7, message: body});
    this._callSubcribe(this._state);
}

    }
};
export const addPostActionCreator = () => ({type: ADD_POST});
export const updateNewPostTextActionCreator = (text) => ({type: UPDATE_NEW_POST_TEXT, newText: text});

export const sendMessageCreator = () => ({type: SEND_MESSAGE});
export const updateNewMessageBodyCreator = (body) => ({type: UPDATE_NEW_POST_BODY, body: body});

export default store;
